insert  into `contents`(`id`,`module`,`module_id`,`language`,`title`,`body`,`additional`,`meta_title`,`meta_description`,`meta_keywords`,`background`,`created`) values (1,'page',2,'ru','Новости',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:09:55'),(2,'page',3,'ru','Реклама',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(3,'page',4,'ru','Storm Vintage',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(4,'page',5,'ru','Информация и сервис',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(5,'page',6,'ru','Зарегистрироваться',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(6,'page',7,'ru','Магазины',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(7,'page',8,'ru','О Storm',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(8,'page',9,'ru','Контакты',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(9,'page',10,'ru','Журналы',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(10,'page',11,'ru','Знаменитости',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(11,'page',12,'ru','Реклама',NULL,NULL,NULL,NULL,NULL,NULL,'2011-08-31 17:12:06'),(12,'category',2,'ru','Часы','<p>Часы STORM изготовлены из высококачественной нержавеющей стали различной обработки и полировки. Все модели часов оснащены японскими или швейцарскими механизмами, царапиноустойчивым минеральным стеклом и анти-аллергенны.</p>',NULL,'Часы','асы STORM изготовлены из высококачественной нержавеющей стали различной обработки и полировки.',NULL,'remi_v2.jpg','2011-09-08 19:04:31'),(13,'category',3,'ru','Бижутерия',NULL,NULL,NULL,NULL,NULL,'jewellery_mens.jpg','2011-09-08 19:05:46'),(14,'category',4,'ru','Коллекции',NULL,NULL,NULL,NULL,NULL,NULL,'2011-09-01 15:24:13'),(15,'category',5,'ru','Мужские','Линия часов STORM для мужчин включают в себя модели выполненные в разных стилях с ярко выраженной индивидуальностью. Различные приспособления и другие уникальные атрибуты делают их ультра-модными аксессуарами для стильных и современных мужчин',NULL,NULL,NULL,NULL,'remi_v2.jpg','2011-09-08 19:06:09'),(16,'category',6,'ru','Женские','Женская коллекция часов STORM создана под влиянием последних модных тенденций. При изготовлении этих часов, помимо стали, используется позолота и драгоценные камни. Также существует серия классических женских часов STORM , известных своим минимализмом и плавностью линий.и плавностью линий.',NULL,NULL,NULL,NULL,'remi_v2.jpg','2011-09-08 19:06:10'),(17,'category',7,'ru','Унисекс','УНИСЕКС Одними из характерных черт дизайна компании STORM являются минимализм и простота. Именно такими являются часы, которые подходят как мужчинам, так и женщинам.',NULL,NULL,NULL,NULL,'remi_v2.jpg','2011-09-08 19:06:11'),(18,'product',1,'ru','Sotec','Sotec - часы простые, но элегантные благодаря плетенному, стальному браслету и стеклу, элегантно окантовывающего корпус, что несомненно добавит акцент престижа к любому наряду. Эти часы также отображают дату и доступны зеленого, синего и белого цвета. Водостойкость до 50м.','<h4>Sotec</h4>\r\n<table>\r\n<tr>\r\n<td>Features</td>\r\n<td>Date</td>\r\n</tr>\r\n<tr>\r\n<td>Battery</td>\r\n<td>Standard Type</td>\r\n</tr>\r\n<tr>\r\n<td>Case Material</td>\r\n<td>Stainless Steel</td>\r\n</tr>\r\n<tr>\r\n<td>Case Size</td>\r\n<td> W : 41.5mm L : 47mm </td>\r\n</tr>\r\n<tr>\r\n<td>Case Height</td>\r\n<td> 6.6mm</td>\r\n</tr>\r\n<tr>\r\n<td>Water Resistance</td>\r\n<td>No</td>\r\n</tr>\r\n<tr>\r\n<td>Lens Material</td>\r\n<td>Mineral</td>\r\n</tr>\r\n<tr>\r\n<td>Caseback</td>\r\n<td>Stainless Steel</td>\r\n</tr>\r\n<tr>\r\n<td>Band Type</td>\r\n<td>Stainless Steel</td>\r\n</tr>\r\n<tr>\r\n<td>Fitting Length</td>\r\n<td>230mm Adjustable</td>\r\n</tr>\r\n<tr>\r\n<td>Weight</td>\r\n<td>63g</td>\r\n</tr>\r\n</table>','Sotec','Sotec - часы простые, но элегантные благодаря плетенному, стальному браслету и стеклу, элегантно окантовывающего корпус, что несомненно добавит акцент престижа к любому наряду.','','','2011-09-13 16:54:39'),(19,'product',2,'ru','Simplex','Simplex это отличный выбор для людей ведущих активный образ жизни. Часы STORM с комфортным, силиконовым, браслетом, с функцией даты, стальным безелем и нанесенным на циферблат принтом. Часы брызгозащищенны и доступны в черном, голубом, белом и фиолетовом цвете.',NULL,NULL,NULL,NULL,NULL,'2011-09-06 17:50:26'),(20,'product',3,'ru','Bion','Bion это стильные мужские часы кожанным ремешком, с принтом под кожу крокодила и вторым часовым механизмом. Эти часы для стильных и уверенных в себе людей доступны в серебрянном / коричневом и черном / черном цветовом исполнении. Часы отображают дату и влагозащищенны до 50 м.',NULL,NULL,NULL,NULL,NULL,'2011-09-06 17:51:09'),(21,'product',4,'ru','Dualmec','Часы STORM Dualmec выпущенны лимитированной серией в количестве 3000 штук. Часы с двумя механизмами, для индикации времени другого часового пояса, с индикацией даты и необычным оформлением циферблата. Эти невероятные часы, выглядящие как произвение современного искусства, влагозащищены и доступны в серебрянном, черном и коричневом исполнении.',NULL,NULL,NULL,NULL,NULL,'2011-09-06 17:51:23'),(22,'product',5,'ru','Noxer','Мудрое решение для человека, следящего за модой и ведущего активный образ жизни. Часы Noxer это хронограф с функцией даты и влагозащищенностью до 50 м. Доступны в черном и стальном исполнении, а так же и с позолоченным и вороненым покрытием корпуса.',NULL,NULL,NULL,NULL,NULL,'2011-09-07 15:14:09'),(23,'product',6,'ru','MK 2 Circuit','MK 2 Circuit - Самые уникальные и необычные часы STORM с LED дисплеем (диодные часы). Индикация времени и даты. Часы доступны в различном цветовом исполнении. Инструкция на русском языке прилагается.',NULL,NULL,NULL,NULL,NULL,'2011-09-07 15:15:14'),(24,'product',7,'ru','Exar','Стильные мужские часы STORM EXAR выполнены в классическом, спортивном стиле, но при этом имеют яркие, стильные цвета. Доступны с белым, черным, голубым и оранжевым циферблатом. Влагозащищенность до 50 м.',NULL,NULL,NULL,NULL,NULL,'2011-09-07 15:15:32'),(25,'product',8,'ru','Darth','Специальный выпуск часов STORM. Часы Darth не оставят равнодушным никого, благодаря их необычному дизайну и дисковому механизму. Часы влагозащищены и доступны с черным, зеркальным, белым и фирменным, STORM, синим цветом дисплея',NULL,NULL,NULL,NULL,NULL,'2011-09-07 15:15:51'),(26,'product',10,'ru','Test','asdfkls jdgflksdgj sk','k jsdf gkjsdfgn sdkjgns fdg','f dsg f','sdg sfg sfdg','g sdfg sdfg ',NULL,'2011-10-06 00:43:22');

