/*Table structure for table `order_details` */

DROP TABLE IF EXISTS `order_details`;

CREATE TABLE `order_details` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(11) unsigned NOT NULL,
  `type` varchar(10) NOT NULL,
  `country_id` int(11) unsigned DEFAULT NULL,
  `region_id` int(11) unsigned DEFAULT NULL,
  `district_id` int(11) unsigned DEFAULT NULL,
  `name` varchar(30) DEFAULT NULL,
  `surname` varchar(30) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `email` varchar(128) DEFAULT NULL,
  `house` varchar(30) DEFAULT NULL,
  `street` varchar(60) DEFAULT NULL,
  `city` varchar(50) DEFAULT NULL,
  `district` varchar(100) DEFAULT NULL,
  `postcode` varchar(10) DEFAULT NULL,
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `order_details_order_id_fkey` (`order_id`),
  KEY `order_details_county_id_fkey` (`country_id`),
  KEY `order_details_region_id_fkey` (`region_id`),
  KEY `order_details_district_id_fkey` (`district_id`),
  CONSTRAINT `order_details_county_id_fkey` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`),
  CONSTRAINT `order_details_district_id_fkey` FOREIGN KEY (`district_id`) REFERENCES `districts` (`id`),
  CONSTRAINT `order_details_order_id_fkey` FOREIGN KEY (`order_id`) REFERENCES `orders` (`id`),
  CONSTRAINT `order_details_region_id_fkey` FOREIGN KEY (`region_id`) REFERENCES `regions` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

